import React from 'react';
import './Person.css';

const names = [{name: "Niv", age: 25}, {name: "Prague", age: 22}, {name: "Dana", age: 25}, {name: "Roy", age: 23}];
const random = names[Math.floor(Math.random() * names.length)];
const person = () => {
    return (
      <div className="person-wrapper">
          <h1>My name is {random.name}</h1>
          <p>My age is {random.age}</p>
      </div>
    );
};

export default person;
